import { fetchIPData } from './IPGetterApi.js';

async function run() {
  for (let i = 1; i <= 7; i++) {
    try {
      const res = await fetchIPData('8.8.8.8');
      console.log(`${i}: OK — ${res.ip || JSON.stringify(res).slice(0,80)}`);
    } catch (e) {
      console.error(`${i}: ERROR — ${e.code || e.name}: ${e.message}`);
    }
  }
}

run().catch(err => console.error('Run failed', err));

export default function IPDataElement({ data }) {
    const { ip, as_name, as_domain, country_code, country, continent } = data || {};

    return (
        <div>
            <div className="flex flex-col items-center justify-center gap-4 p-4 border rounded shadow-lg bg-black text-white rounded-2xl">
                <h2>IP Address Information</h2>
                <p><strong>IP:</strong> {ip}</p>
                <p><strong>AS Name:</strong> {as_name}</p>
                <p><strong>AS Domain:</strong> {as_domain}</p>
                <p><strong>Country Code:</strong> {country_code}</p>
                <p><strong>Country:</strong> {country}</p>
                <p><strong>Continent:</strong> {continent}</p>
            </div>
        </div>
    );
}

